import React, {Component} from "react";
import data from '../data';

class Table extends Component {
    constructor(props) {
        super(props)
        this.state = {
            products: data,
        }
    }
    render() {
        return (
            <div>
                <h1>Garun Menu Table</h1>
            </div>
        )
    }
}

export default Table;
